// 페이지들의 공통속성 처리
import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'

const App = ({Component}) => {
    return (
        <Component/>
    );
}

App.propTypes = {
    Component : PropTypes.elementType.isRequired,
}
export default App;
